/*Table structure for table `ware_info` */

CREATE TABLE `ware_info` (
  `id` bigint(20) NOT NULL,
  `name` varchar(200) DEFAULT NULL,
  `address` varchar(200) DEFAULT NULL,
  `areacode` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `ware_info` */

/*Table structure for table `ware_order_task` */

CREATE TABLE `ware_order_task` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单编号',
  `consignee` varchar(100) DEFAULT NULL COMMENT '收货人',
  `consignee_tel` varchar(20) DEFAULT NULL COMMENT '收货人电话',
  `delivery_address` varchar(1000) DEFAULT NULL COMMENT '送货地址',
  `order_comment` varchar(200) DEFAULT NULL COMMENT '订单备注',
  `payment_way` varchar(2) DEFAULT NULL COMMENT '付款方式 1:在线付款 2:货到付款',
  `task_status` varchar(20) DEFAULT NULL COMMENT '工作单状态',
  `order_body` varchar(200) DEFAULT NULL COMMENT '订单描述',
  `tracking_no` varchar(200) DEFAULT NULL COMMENT '物流单号',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `ware_id` bigint(20) DEFAULT NULL COMMENT '仓库编号',
  `task_comment` varchar(500) DEFAULT NULL COMMENT '工作单备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='库存工作单表 库存工作单表';

/*Data for the table `ware_order_task` */

/*Table structure for table `ware_order_task_detail` */

CREATE TABLE `ware_order_task_detail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `sku_id` bigint(20) DEFAULT NULL COMMENT 'sku_id',
  `sku_name` varchar(200) DEFAULT NULL COMMENT 'sku名称',
  `sku_num` int(11) DEFAULT NULL COMMENT '购买个数',
  `task_id` bigint(20) DEFAULT NULL COMMENT '工作单编号',
  `refund_status` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='库存工作单明细表 库存工作单明细表';

/*Data for the table `ware_order_task_detail` */

/*Table structure for table `ware_sku` */

CREATE TABLE `ware_sku` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `sku_id` bigint(20) DEFAULT NULL COMMENT 'skuid',
  `warehouse_id` bigint(20) DEFAULT NULL COMMENT '仓库id',
  `stock` int(11) DEFAULT NULL COMMENT '库存数',
  `stock_name` varchar(200) DEFAULT NULL COMMENT '存货名称',
  `stock_locked` int(11) DEFAULT NULL COMMENT '锁定库存数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='sku与仓库关联表';

/*Data for the table `ware_sku` */

/*Table structure for table `base_category_view` */

DROP TABLE IF EXISTS `base_category_view`;

/*!50001 CREATE TABLE  `base_category_view`(
 `id` bigint(20) ,
 `category1_id` bigint(20) ,
 `category1_name` varchar(10) ,
 `category2_id` bigint(20) ,
 `category2_name` varchar(200) ,
 `category3_id` bigint(20) ,
 `category3_name` varchar(200) 
)*/;

/*View structure for view base_category_view */

/*!50001 DROP TABLE IF EXISTS `base_category_view` */;
/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `base_category_view` AS select `c3`.`id` AS `id`,`c1`.`id` AS `category1_id`,`c1`.`name` AS `category1_name`,`c2`.`id` AS `category2_id`,`c2`.`name` AS `category2_name`,`c3`.`id` AS `category3_id`,`c3`.`name` AS `category3_name` from ((`base_category1` `c1` join `base_category2` `c2` on((`c2`.`category1_id` = `c1`.`id`))) join `base_category3` `c3` on((`c3`.`category2_id` = `c2`.`id`))) */;

